import * as React from "react";
import Tabs from "@mui/material/Tabs";
import Tab from "@mui/material/Tab";
import Box from "@mui/material/Box";
import Avatar from "@mui/material/Avatar";
import { Typography, Select, MenuItem, FormControl, InputLabel } from "@mui/material";
import { motion } from "framer-motion";
import EventInvitation from "./EventInvitation";

export default function Party() {
  const [currentTabIndex, setCurrentTabIndex] = React.useState(0);

  // Array of event types for easy reference
  const eventTypes = ["Birthday", "Wedding", "House Warming", "Baby Shower"];

  // Handle tab change
  const handleTabChange = (e, tabIndex) => {
    setCurrentTabIndex(tabIndex);
  };

  // Handle dropdown selection change
  const handleDropdownChange = (event) => {
    const selectedEvent = event.target.value;
    const tabIndex = eventTypes.indexOf(selectedEvent);
    setCurrentTabIndex(tabIndex); // Update the tab index based on the selected event type
  };

  return (
    <div
      style={{
        display: "flex",
        justifyContent: "center",
        flexDirection: "column",
        alignItems: "center",
      }}
    >
      <Box
        sx={{
          maxWidth: { xs: 320, sm: 1500 },
          bgcolor: "background.paper",
          width: "100%",
        }}
      >
        {/* Dropdown to select event type */}
        <FormControl fullWidth sx={{ mb: 3 }}>
          <InputLabel id="event-select-label">Select Event Type</InputLabel>
          <Select
            labelId="event-select-label"
            value={eventTypes[currentTabIndex]} // Make the dropdown reflect the current tab
            label="Select Event Type"
            onChange={handleDropdownChange}
          >
            {eventTypes.map((eventType, index) => (
              <MenuItem key={index} value={eventType}>
                {eventType}
              </MenuItem>
            ))}
          </Select>
        </FormControl>

        {/* Tabs to display event types with icons */}
        <Box sx={{ display: "flex", justifyContent: "center" }}>
          <Tabs
            value={currentTabIndex}
            onChange={handleTabChange}
            variant="scrollable"
            scrollButtons="auto"
            aria-label="scrollable auto tabs example"
          >
            <Tab
              icon={
                <motion.div
                  whileHover={{
                    scale: 1.1,
                    transition: { duration: 0.3 },
                  }}
                >
                  <Avatar
                    alt="birthday"
                    src="https://cdn-icons-png.flaticon.com/512/4549/4549811.png"
                    sx={{ width: 80, height: 90 }}
                  />
                </motion.div>
              }
            />
            <Tab
              icon={
                <motion.div
                  whileHover={{
                    scale: 1.1,
                    transition: { duration: 0.3 },
                  }}
                >
                  <Avatar
                    alt="wedding"
                    src="https://media.istockphoto.com/id/1072540494/vector/wedding-rings-icon.jpg?s=612x612&w=0&k=20&c=8g6Kh2hwUqJPW_EXAtPVeEUSNyD-h1GD4EiWc2QtG9g="
                    sx={{ width: 80, height: 90 }}
                  />
                </motion.div>
              }
            />
            <Tab
              icon={
                <motion.div
                  whileHover={{
                    scale: 1.1,
                    transition: { duration: 0.3 },
                  }}
                >
                  <Avatar
                    alt="house-warming"
                    src="https://media.istockphoto.com/id/1316642892/vector/home-sweet-home-black-and-white-image-of-a-house-with-a-quote.jpg?s=612x612&w=0&k=20&c=BKCCbt5M1INcSkRPQT4SWmIFuG-jrcr_bvgqGFKM-D0="
                    sx={{ width: 80, height: 90 }}
                  />
                </motion.div>
              }
            />
            <Tab
              icon={
                <motion.div
                  whileHover={{
                    scale: 1.1,
                    transition: { duration: 0.3 },
                  }}
                >
                  <Avatar
                    alt="baby-shower"
                    src="https://cdn-icons-png.flaticon.com/512/8338/8338143.png"
                    sx={{ width: 80, height: 90 }}
                  />
                </motion.div>
              }
            />
          </Tabs>
        </Box>

        {/* Displaying event invitation based on selected tab */}
        <Box sx={{ mt: 4, textAlign: "center" }}>
          <Typography variant="h5">{eventTypes[currentTabIndex]}</Typography>
          <EventInvitation selectedEventType={eventTypes[currentTabIndex]} />
        </Box>
      </Box>
    </div>
  );
}
